oracleReaderQuery.value:
select  /*+INDEX(t,SALESDISCOUNTTYPES_MODIFIED) */ * from BETADATA.SALESDISCOUNTTYPES t where SDT_MODIFIED >= TO_DATE('@{formatDateTime(pipeline().parameters.windowStart, 'yyyy-MM-dd HH:mm' )}', 'YYYY-MM-DD HH24:MI') 
AND SDT_MODIFIED < TO_DATE('@{formatDateTime(pipeline().parameters.windowEnd, 'yyyy-MM-dd HH:mm' )}', 'YYYY-MM-DD HH24:MI')
AND VPD_ID in @{item().vpd_list}
